Pakai dalam 6 bulan je.

Translated Text:
@XavierNaxa Android users, try to change the wind using iPhone 6 in 2017.

Satisfied with the design and neatness of iOS, but I can't adapt directly because it feels too controlled, I want to customize even simple things. The battery is also very weak, does not last long.

Use in 6 months only.

